package extras.numbers;

import java.util.Arrays;

public class bigNumberMultiply {

    public static int[] multiply(int[] nums1, int[] nums2) {
        int[] res = new int[nums1.length + nums2.length];
        for (int i = 0; i < nums1.length; i++) {
            for (int j = 0; j < nums2.length; j++) {
                res[i + j] += nums1[i] * nums2[j];
            }
        }
        for (int i = 1; i < res.length; i++) {
            res[i] += res[i - 1] / 10;
            res[i - 1] = res[i - 1] % 10;
        }
        return res;
    }

    public static int[] karatsubaMultiply(String nums1, String nums2) {
        if (nums1.length() < 3 && nums2.length() < 3) {
            Integer res = Integer.parseInt(nums1) * Integer.parseInt(nums2);
            int[] temp = new int[String.valueOf(res).length()];
            for (int i = 0; i < temp.length; i++) {
                temp[i] = res % 10;
                res = res / 10;
            }
            return temp;
        }

        int halfN = Math.max(nums1.length(), nums2.length()) / 2;
        String a = halfN >= nums1.length() ? "0" : nums1.substring(0, nums1.length() - halfN);
        String b = halfN >= nums1.length() ? nums1 : nums1.substring(nums1.length() - halfN);
        String c = halfN >= nums2.length() ? "0" : nums2.substring(0, nums2.length() - halfN);
        String d = halfN >= nums2.length() ? nums2 : nums2.substring(nums2.length() - halfN);

        int[] ac = karatsubaMultiply(a, c);
        int[] ad = karatsubaMultiply(a, d);
        int[] bc = karatsubaMultiply(b, c);
        int[] bd = karatsubaMultiply(b, d);

        int[] res = new int[2 * halfN + ac.length + 1];
        for (int i = 0; i < bd.length; i++) {
            res[i] += bd[i];
        }
        for (int i = 0; i < ad.length; i++) {
            res[i + halfN] += ad[i];
        }
        for (int i = 0; i < bc.length; i++) {
            res[i + halfN] += bc[i];
        }
        for (int i = 0; i < ac.length; i++) {
            res[i + 2 * halfN] += ac[i];
        }
        for (int i = 1; i < res.length; i++) {
            res[i] += res[i - 1] / 10;
            res[i - 1] = res[i - 1] % 10;
        }
        return res;
    }

    public static String multiply(String num1, String num2) {
        int[] res = karatsubaMultiply(num1,num2);
        StringBuilder sb = new StringBuilder();
        int index = res.length-1;
        while(index > 0 && res[index] == 0) index--;
        for (int i = index; i >= 0 ; i--) {
            sb.append(res[i]);
        }
        return sb.toString();
    }
    public static void main(String[] args) {
        int[] nums1 = {1, 8, 3, 6, 8, 7};
        int[] nums2 = {9, 8, 5, 8, 5, 4, 8, 5, 4, 8};
        String num1 = "";
        String num2 = "";
        System.out.println(Arrays.toString(multiply(nums1, nums2)));
        System.out.println(num1.length());
        System.out.println(num2.length());

        long startTime=System.currentTimeMillis();   //获取开始时间
        System.out.println(multiply(num1,num2).length());  //测试的代码段
        long endTime=System.currentTimeMillis(); //获取结束时间
        System.out.println("程序运行时间： "+(endTime-startTime)+"ms");

    }
}
